import React from "react";
import PropTypes from 'prop-types'; 

export default function ButtonStyle1({ buttonText, onClick , buttonClassName}){
    return(
      <button onClick={onClick} className={`bg-[#1E3A8A] hover:bg-[#3B82F6] text-white rounded-[5px] px-5 py-2 text-[16px] font-Cairo ${buttonClassName}`}>
      {buttonText}
    </button>
    );
}

ButtonStyle1.propTypes = {
    text: PropTypes.string.isRequired, // التأكد من أن النص يجب أن يكون سلسلة نصية
    onClick: PropTypes.func.isRequired, // التأكد من أن onClick يجب أن تكون دالة
    className: PropTypes.string, // className هي خاصية اختيارية
  };
